SET NAMES 'utf8';
SET CHARACTER SET utf8;

CREATE TABLE `subject` (
  `id` INT NOT NULL AUTO_INCREMENT,
  `name` VARCHAR(255),
  `header_image` LONGTEXT,
  `preview` LONGTEXT,
  `preview_image` LONGTEXT,
  `content` LONGTEXT,
  `content_image` LONGTEXT,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;


INSERT INTO `subject` (`name`, `header_image`, `preview`, `preview_image`, `content`, `content_image`) VALUES
('Expresión Gráfica en la Ingeniería', 'data:image/jpeg;base64,', ' <p>Los estudiantes explorarán desde la representación de figuras básicas hasta la resolución de problemas complejos. Aprenderán técnicas esenciales de representación gráfica, vitales en el ámbito de la ingeniería.</p>\n<ul>\n   <li><strong>Normalización:</strong> Vistas de figuras y metodología. Ejercicios con 30 figuras y soluciones.</li>\n   <li><strong>Sistema Diédrico:</strong> Generalidades, métodos operativos, distancias, ángulos, formas geométricas y desarrollos.</li>\n   <li><strong>Perspectiva Axonométrica:</strong> Isométrica, Caballera, y ejercicios relacionados.</li>\n   <li><strong>Planos Acotados:</strong> Puntos, rectas, planos, acotamientos, dibujo topográfico y geometría plana.</li>\n</ul>', 'data:image/png;base64,', '<h1>Expresión Gráfica en la Ingeniería</h1>\n    <p>Curso diseñado para adquirir los conocimientos necesarios para aprobar la asignatura partiendo de cero.</p>\n\n    <h2>Metodología</h2>\n    <p>Todas nuestras clases han sido grabadas en pizarra, igual que en clases presenciales. Dispondrás de clases de teoría aplicada a los ejercicios y resolución de ejercicios.</p>\n    <ul>\n        <li>En las clases de teoría, toma apuntes y haz esquemas.</li>\n        <li>En las clases de ejercicios, resuélvelos al mismo tiempo que los explica el profesor.</li>\n    </ul>\n    <p><strong>Vídeos de teoría y ejercicios:</strong></p>\n    <ul>\n        <li>Todas las clases explicadas en pizarra, paso a paso (ver ejemplos).</li>\n        <li>Aprende dibujo técnico a tu ritmo.</li>\n    </ul>\n\n    <h2>Tres cursos al año</h2>\n    <p>Puedes incorporarte en cualquier momento.</p>\n    <ul>\n        <li><strong>Inicio:</strong> Primer semestre. 1 de Octubre 2023.</li>\n        <li><strong>Finalización:</strong> Fecha de examen ordinario: Febrero 2024.</li>\n        <li><strong>Inicio:</strong> Primer semestre. 1 de Marzo 2024.</li>\n        <li><strong>Finalización:</strong> Fecha de examen extraordinario: Junio 2024.</li>\n        <li><strong>Inicio:</strong> Curso de verano: 1 de Julio 2024..</li>\n        <li><strong>Finalización:</strong> Fecha de examen: Septiembre 2024.</li>\n    </ul>\n\n    <h2>Precio y forma de pago</h2>\n    <ul>\n        <li><strong>Matrícula gratuita.</strong></li>\n        <li><strong>Precio del curso:</strong> 200€.</li>\n        <li><strong>Forma de pago:</strong>\n            <ul>\n                <li>Ingreso por Transferencia bancaria o Bizum.</li>\n                <li>Ponte en contacto con secretaría: Teléfono y WhatsApp: 699136622.</li></ul></li></ul><p></p><ul></ul><p></p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"big_58027996_0_330-328.jpg\" style=\"width: 330px;\"><span style=\"background-color: var(--bs-body-bg); font-family: var(--font-global); font-size: 2.875rem; font-weight: 600; letter-spacing: -0.04em; text-align: var(--bs-body-text-align);\"><br></span></p><p><span style=\"background-color: var(--bs-body-bg); font-family: var(--font-global); font-size: 2.875rem; font-weight: 600; letter-spacing: -0.04em; text-align: var(--bs-body-text-align);\">Contenidos del curso</span></p>', 'data:image/png;base64,');
